INSERT INTO `recipes` VALUES ('054258b8-53d3-4453-8ebd-34e4f933fe93','Salsa de Molcajete',NULL,'Salsa_de_Molcajete.jpg','','','','https://www.bonappetit.com/recipe/salsa-de-molcajete',1,'2022-04-06 02:15:01.360868','Tangy, smokey, and just a touch spicy, this simple salsa from Bricia Lopez made with charred tomatoes shows how just a few ingredients can transform into something truly spectacular.'),('15b901f9-3232-4f6e-9664-a243c932fe32','Karak Chai',NULL,'Karak_Chai.jpg','','','','https://www.bonappetit.com/recipe/karak-chai',1,'2022-04-06 02:14:47.625884','Recipe developer Zaynab Issa\'s Karak Chai recipe is richer than most cups of tea, thanks to its generous use of evaporated milk and hints of vanilla, cinnamon, and cardamom.'),('1be483a2-eafd-4db8-bc19-f45b9efb8a3c','Toasted Marshmallow Cake',NULL,'Toasted_Marshmallow_Cake.jpg','40 mins ','20 mins ','1 hr ','https://www.allrecipes.com/recipe/8373688/toasted-marshmallow-cake/',1,'2022-04-06 02:04:59.743084','This delicious white cake features toasted marshmallows in the batter for a truly spectacular dessert.'),('1d732269-5ba6-4e29-a127-da0a2b6fa54f','Mortadella Wedge Salad',NULL,'Mortadella_Wedge_Salad.jpg','','','','https://www.bonappetit.com/recipe/mortadella-wedge-salad',1,'2022-04-06 02:22:08.191419','This salad isn\'t like a regular wedge, it\'s a cool wedge—and by \"cool\" we mean stuffed with pickled jalapeños and paper-thin slices of mortadella and drizzled with a tangy buttermilk dressing.'),('1ea1dea2-4aa0-4f76-9f5b-eb832e515554','Broccoli Cheddar Soup With Cheesy Croutons',NULL,'Broccoli_Cheddar_Soup_With_Cheesy_Croutons.jpg','','','','https://www.bonappetit.com/recipe/broccoli-cheddar-soup',1,'2022-04-06 02:25:07.692933','Our easy broccoli cheddar soup recipe is lighter than some versions, thickened with puréed vegetables instead of cream—and finished with cheesy croutons.'),('25c855c1-a417-4c89-8683-1485925a9870','Beauty-Food Mango Slushy',NULL,'Beauty-Food_Mango_Slushy.jpg','','','','https://www.bonappetit.com/recipe/beauty-food-mango-slushy',1,'2022-04-06 02:27:09.733981','Mangoes are packed with vitamins C and A, both of which provide major skin-brightening benefits. Lime and chile keep this slushy spicy and bright. This recipe is part of the Healthyish slushy trifecta.'),('2e0c1573-6f3b-4c6b-90e4-5dff011b9673','BA\'s Best Pesto',NULL,'BA\'s_Best_Pesto.jpg','','','','https://www.bonappetit.com/recipe/best-pesto',1,'2022-04-06 02:15:21.338982','The key for this classic pesto recipe is to add the basil at the very end so it doesn’t get bruised or lose its flavor and maintains its vibrant green color.'),('30386c99-cc37-49c8-8110-7eabf566410c','Cacao and Coconut Latte',NULL,'Cacao_and_Coconut_Latte.jpg','','','','https://www.bonappetit.com/recipe/cacao-coconut-latte',1,'2022-04-06 02:17:00.291422','For a more caramel-y depth of flavor (or if you just really love coconut), toast the coconut flakes first and substitute coconut sugar for the organic sugar.'),('3107980b-9142-415e-9b29-b1ffe0e24119','Silky Steamed Eggs with Mushrooms',NULL,'Silky_Steamed_Eggs_with_Mushrooms.jpg','','','','https://www.bonappetit.com/recipe/mushroom-steamed-eggs',1,'2022-04-06 02:13:48.568143','These savory and oh-so-simple steamed eggs are the definition of cozy comfort food.'),('35a89094-78da-4931-96cc-d5cbf0f5d6fb','Teriyaki Ground Beef Skillet',NULL,'Teriyaki_Ground_Beef_Skillet.jpg','10 mins ','15 mins ','25 mins ','https://www.allrecipes.com/recipe/284172/teriyaki-ground-beef-skillet/',1,'2022-04-06 02:04:36.166213','A quick and easy one-pan, kid friendly teriyaki ground beef skillet dinner with sweet, rich, and flavorful meat and Asian flavors. Served with white rice.'),('3cd3f061-f3bc-4042-84c6-bb5f13722996','Tartar Sauce',NULL,'Tartar_Sauce.jpg','','','','https://tastesbetterfromscratch.com/tartar-sauce/',1,'2022-03-06 02:44:17.897809','This homemade Tartar Sauce recipe is creamy and fresh! It only takes 5 minutes to make, and tastes so much better than store-bought!'),('3e8dddec-93d9-463f-b084-f13b1086dea8','Grape-Tarragon Spritzer',NULL,'Grape-Tarragon_Spritzer.jpg','','','','https://www.bonappetit.com/recipe/grape-tarragon-spritzer',1,'2022-04-06 02:14:06.674194','Looking for the ultimate booze-free cooler? Try Bryant Terry’s refreshing grape-tarragon spritzer, which cleverly keeps its cool with frozen grapes instead of ice cubes.'),('4ddb632f-e9f1-4eed-a3bc-dc0984887e63','Fettuccine Alfredo',NULL,'Fettuccine_Alfredo.jpg','','','','https://www.bonappetit.com/recipe/fettuccine-alfredo',1,'2022-04-06 02:13:11.243474','A fettuccine Alfredo recipe should never include cream; the silky sauce comes from an emulsion of grated Parmesan, melted butter, and starchy pasta water.'),('5bab4042-9684-4fae-ad3b-5f5de9350580','Mango and Avocado Salad',NULL,'Mango_and_Avocado_Salad.jpg','','','','https://www.bonappetit.com/recipe/mango-and-avocado-salad',1,'2022-04-06 02:22:33.097295','With creamy avocado and sweet ripe mango, this cooling salad will complement a meal that’s big on heat and spice.'),('6570af5a-e811-45b8-a533-c4f06438e1ff','Spicy Sesame Coleslaw',NULL,'Spicy_Sesame_Coleslaw.jpg','','20 mins','20 mins','https://www.101cookbooks.com/spicy-sesame-coleslaw/',1,'2022-03-20 23:18:47.975286','A spicy sesame coleslaw with feathery green and red cabbages along with carrots, apples, and scallions tossed with a spicy, creamy sesame dressing.'),('666a0b5b-90a1-427b-940e-9316d3b67ef8','Asian Pear–Shiso Salad With Quinoa',NULL,'Asian_Pear–Shiso_Salad_With_Quinoa.jpg','','','','https://www.bonappetit.com/recipe/asian-pear-shiso-salad-with-quinoa',1,'2022-04-06 02:21:52.592405','This layered salad is a garden of textural delight with crisp Asian pear, creamy Greek yogurt, and a shower of quinoa.'),('6c629135-2f44-49dd-bb25-0141b773a34e','Espresso Hot Chocolate',NULL,'Espresso_Hot_Chocolate.jpg','','','','https://www.bonappetit.com/recipe/espresso-hot-chocolate',1,'2022-04-06 02:17:32.377365','If you want to mellow this out a bit, use strong coffee or a couple teaspoons of espresso powder instead of the freshly made espresso.'),('85cb832a-a110-46ea-a7db-ccfcfbc883ab','Mozzarella Fritters With Pesto and Greens',NULL,'Mozzarella_Fritters_With_Pesto_and_Greens.jpg','','','','https://www.bonappetit.com/recipe/mozzarella-fritters',1,'2022-04-06 02:23:22.687424','These crispy-creamy fritters come together even faster than you\'ll devour them.'),('87a32415-38d7-47b0-ac8e-13c8d2860fa4','Fried Lemon and Radish Salad',NULL,'Fried_Lemon_and_Radish_Salad.jpg','','','','https://www.bonappetit.com/recipe/fried-lemon-and-radish-salad',1,'2022-04-06 02:21:23.994616','You can—and you should!—eat fried slices of lemon in your salad. (Trust us.)'),('87c7f114-0945-4706-b90f-76de7818c35b','Blueberry Smoothie',NULL,'Blueberry_Smoothie.jpg','','5 mins ','5 mins ','https://www.allrecipes.com/recipe/215184/blueberry-smoothie/',1,'2022-04-06 02:06:11.529059','This blueberry smoothie with plain yogurt is seasoned with a bit of nutmeg.'),('893397cd-a91f-4f09-a179-7376cef82601','Red Lentil Soup With Preserved Lemon and Crispy Garlic',NULL,'Red_Lentil_Soup_With_Preserved_Lemon_and_Crispy_Garlic.jpg','','','','https://www.bonappetit.com/recipe/red-lentil-soup-with-preserved-lemon',1,'2022-04-06 02:24:53.948577','With the help of punchy preserved lemon and crispy garlic chips, that bag of lentils in the back of your pantry is in for a major—and shockingly simple—glow-up.'),('97a5aba6-9d39-47da-b4a9-9e75d92d7e01','Banana, Coffee, Cashew, and Cocoa Smoothie',NULL,'Banana,_Coffee,_Cashew,_and_Cocoa_Smoothie.jpg','','','','https://www.bonappetit.com/recipe/banana-coffee-cashew-cocoa-smoothie',1,'2022-04-06 02:27:18.662638','This power-breakfast smoothie will be extra smooth if you soak the nuts and oats in water overnight; drain before proceeding.'),('a3b6891b-fad3-4c7a-9240-cbd0cb2fb132','Napa Cabbage Wedge With Sesame Ranch',NULL,'Napa_Cabbage_Wedge_With_Sesame_Ranch.jpg','','','','https://www.bonappetit.com/recipe/napa-cabbage-wedge-with-sesame-ranch',1,'2022-04-06 02:21:37.525816','Iceberg’s reign over the wedge salad stops here.'),('a3e3c39d-34f8-42b7-9727-3711233f1bce','Passion Fruit Bars',NULL,'Passion_Fruit_Bars.jpg','','','','https://www.bonappetit.com/recipe/passion-fruit-bars',1,'2022-04-06 02:18:39.917622','Lemon bars on holiday in the tropics.'),('b4191208-a0a1-4ea3-a1ce-e6cdeca0af94','French Toast',NULL,'French_Toast.jpg','10 mins ','5 mins ','15 mins ','https://www.allrecipes.com/recipe/7016/french-toast-i/',1,'2022-03-20 22:14:31.963070','This delicious French toast recipe can be ready in about 15 minutes with eggs, milk, a few spices, and your favorite bread.'),('b6807a17-f27c-42aa-a722-930084f8b211','Best-Ever Grilled Cheese',NULL,'Best-Ever_Grilled_Cheese.jpg','','','','https://www.bonappetit.com/recipe/best-ever-grilled-cheese',1,'2022-04-06 02:12:57.919581','Looking to majorly upgrade the classic grilled cheese? This recipe has you covered with bread slicked with and crisped up by the power of mayonnaise.'),('ba62229e-0ab7-4b07-b4e8-de3b7d876f3b','Cocoa-Coffee Almond Cookies',NULL,'Cocoa-Coffee_Almond_Cookies.jpg','','','','https://www.bonappetit.com/recipe/cocoa-coffee-almond-cookies',1,'2022-04-06 02:19:06.134268','Almond paste makes these supremely fudgy cookies extra chewy, while coffee adds a savory note that complements the chocolate and nut flavors.'),('ce7c42d8-f557-42e1-8e53-d9925bcafd3b','Moroccan-inspired chickpea stew',NULL,'Moroccan-inspired_chickpea_stew.jpg','','45 min.','','https://www.kitchenstories.com/en/recipes/moroccan-inspired-chickpea-stew',1,'2022-03-06 00:56:48.735727','Peel and finely dice onion and garlic. Peel carrots and sweet potatoes and cut into bite-size pieces. Deseed and dice bell pepper. Remove leaves and core from fennel and chop rest into small pieces. Wash kale, remove leaves from stems, and cut or tear into bite-size pieces.'),('d1466bc9-050b-425e-ad8e-af0675f32354','Chewy Date and Dark Chocolate Cookies',NULL,'Chewy_Date_and_Dark_Chocolate_Cookies.jpg','','','','https://www.bonappetit.com/recipe/chewy-date-and-dark-chocolate-cookies',1,'2022-04-06 02:18:28.897492','Not just another chocolate chip cookie.'),('dcfd256e-b215-4d56-9502-9fd095113a11','Chef John\'s Waldorf Salad',NULL,'Chef_John\'s_Waldorf_Salad.jpg','','20 mins ','20 mins ','https://www.allrecipes.com/recipe/245363/chef-johns-waldorf-salad/',1,'2022-04-06 02:09:22.103037','Chef John uses chopped celery root in his version of this classic salad--just 4 ingredients and a creamy dressing is all it takes.'),('dd24945a-27fb-47d8-994f-7470d8aaf38a','Chocolate Chip Pancakes',NULL,'Chocolate_Chip_Pancakes.jpg','10 mins ','10 mins ','30 mins ','https://www.allrecipes.com/recipe/8375465/chocolate-chip-pancakes/',1,'2022-04-03 00:48:56.245812','This is a great recipe for homemade chocolate chip pancakes - they are essentially buttermilk pancakes with chocolate chips, only you make your own buttermilk.'),('dd51b859-f756-4e11-8be5-f6209bb068e8','Pasta al Limone',NULL,'Pasta_al_Limone.jpg','','','','https://www.bonappetit.com/recipe/pasta-al-limone',1,'2022-04-06 02:12:33.632903','This creamy pasta al limone recipe is luscious and amply cheesy, but still bright and fresh thanks to fresh lemon juice. Make it for dinner in just 15 minutes.'),('e60e7c73-32ac-4170-916e-6a8a0733070c','Vegetable Fried Rice',NULL,'Vegetable_Fried_Rice.jpg','12 mins','15 mins','27 mins','https://www.budgetbytes.com/vegetable-not-fried-rice/',1,'2022-04-06 02:11:01.219681','Vegetable Fried Rice is a fast, easy, delicious, and budget-friendly meal that you can whip up with ingredients on hand at any time!'),('e89aaa1b-efd1-444b-a26d-76f2c8a70e12','Porterhouse With Summer Au Poivre Sauce',NULL,'Porterhouse_With_Summer_Au_Poivre_Sauce.jpg','','','','https://www.bonappetit.com/recipe/porterhouse-with-summer-au-poivre-sauce',1,'2022-04-06 02:16:09.360427','Getting a porterhouse steak to a blushing, consistent medium-rare is a feat—but the key is to keep it moving.'),('f211abb9-326f-4fce-ba5d-893fe97909fe','Fattoush',NULL,'Fattoush.jpg','','','','https://www.bonappetit.com/recipe/fattoush',1,'2022-04-06 02:23:00.120295','Lebanon\'s most famous salad, fattoush, is a juicy, crunchy mix of herbs, cucumber, tomatoes, and pita, bright with the flavor of sumac.'),('f3248d19-b91e-46da-b3ab-8735aac7c391','Roasted Sweet Potatoes',NULL,'Roasted_Sweet_Potatoes.jpg','','','','https://www.bonappetit.com/recipe/roasted-sweet-potatoes',1,'2022-04-06 02:15:43.567097','Looking for a roasted sweet potatoes recipe that comes out great every time? Here’s the best (and easiest) way to make sweet potatoes in 45 minutes!'),('f5762675-fe7e-4f23-83da-e8f379b8fef7','Classic Caesar Salad',NULL,'Classic_Caesar_Salad.jpg','','','','https://www.bonappetit.com/recipe/classic-caesar-salad',1,'2022-04-06 02:11:28.230638','A great Caesar salad recipe like this one gets its swagger from cold and crisp greens, a creamy and briny dressing, and freshly made croutons.'),('f852a4dc-e20b-4a41-acd6-789db0813143','Summer Gazpacho',NULL,'Summer_Gazpacho.jpg','','','','https://www.bonappetit.com/recipe/summer-gazpacho',1,'2022-04-06 02:25:27.608816','A great, nay, the best gazpacho recipe starts with epic tomatoes—because this preparation is raw, there’s no hiding a sub-standard specimen. Go for gold! Er—red?'),('fcd030aa-35d1-4f31-95d6-f2bb0bd7c902','Autumn Waldorf Salad',NULL,'Autumn_Waldorf_Salad.jpg','','20 mins ','50 mins ','https://www.allrecipes.com/recipe/255841/autumn-waldorf-salad/',1,'2022-04-06 02:09:04.169761','This fall spin on a Waldorf salad made with apple, pear, celery, cranberries, and yogurt is a light side dish with festive autumnal flavor.'),('fd273271-21a1-43b1-b0bb-4e8c22c19b21','Basic Chicken Salad',NULL,'Basic_Chicken_Salad.jpg','5 mins ','5 mins ','10 mins ','https://www.allrecipes.com/recipe/8499/basic-chicken-salad/',1,'2022-04-06 02:07:42.818089','This creamy chicken salad recipes uses basic ingredients, along with crunchy almonds and celery, to produce a delicious lunch that\'s ready in just 10 minutes.'),('fde67312-80de-43bd-8c1a-196393822bfc','Chickpea Noodle Soup',NULL,'Chickpea_Noodle_Soup.jpg','','','','https://www.bonappetit.com/recipe/chickpea-noodle-soup',1,'2022-04-06 02:24:43.427671','There\'s triple the chickpea in this quick and comforting soup: The broth is flavored with chickpea miso, and the mix of soft and crispy chickpeas makes for a delightful mix of textures.'),('fed3dedf-43b3-4de5-9433-6028e601bcf1','The Perfect Egg Salad Sandwich',NULL,'The_Perfect_Egg_Salad_Sandwich.jpg','','10 mins','18 mins','https://www.101cookbooks.com/egg-salad/',1,'2022-03-13 23:39:12.974131','The perfect egg salad sandwich is all about the little tweaks and a smart ratio of eggs to other ingredients. This is my favorite. Served on garlic-rubbed toasted bread with chopped celery, onion, and whole-grain mustard.');
